import { React, useEffect, useState, useCallback } from "react";
import "./index.css"

function Loggin() {
    const [userName, setUsername] = useState("");
    const [passWord, setPassword] = useState("");
    const handleOnChange = (event) => {
        setUsername(event.target.value);
        setPassword(event.target.value);
      };

    return (
        <div id="logginContainer">

            <div className="logginTittle">Loggin To selfManagnment</div>

            <div className="logginBlockContainer">
                <div className="logginUsername">UserName: 
                <input
                 type="text" 
                 name="userNameValue"
                 placeholder="userName"
                 onChange={handleOnChange}
                 /> </div>
                <div className="logginPassword">PassWord: <input 
                name="passWordValue"
                type="text" 
                placeholder="password"
                /></div>


            </div>
            <div className="logginSignUpContainer">
                <div className="logginBtn">
                <button>LoggIn</button>
                </div>
                <div className="signUpBtn">
                <button>SignUp</button>
                </div>

            </div>






        </div>




    )


}
export default Loggin;
